import React, {useState} from 'react';
import {Link} from 'react-router-dom'

function UserRegister() {

    const [userInfo, setUserInfo] = useState({
        email: '',
        password: ''
    });

    const handleSubmit = (event) => {
        event.preventDefault();
    }
    return (
        <div className="d-flex justify-content-center align-items-center bg-primary vh-100">
            <div className="bg-white p-3 rounded w-25">
            <h1 className="text-center">Register</h1>
                <form action="" onSubmit={handleSubmit}>
                    <div className="mb-3 text-center">
                        <label htmlFor="name"><strong>Name</strong></label>
                        <input type="name" placeholder="Enter Your Name" className="form-control rounded-0" onChance/>
                    </div>
                    <div className="mb-3 text-center">
                        <label htmlFor="email"><strong>Email</strong></label>
                        <input type="email" placeholder="Enter Your Email" className="form-control rounded-0"/>
                    </div>
                    <div className="mb-3 text-center">
                        <label htmlFor="password"><strong>Password</strong></label>
                        <input type="password" placeholder="Enter Your Password" className="form-control rounded-0"/>
                    </div>
                    <Link to="/" className="btn btn-success w-100 text-decoration-none">Create Account</Link>
                </form>
            </div>
        </div>
    )
}

export default UserRegister;
